{"metadata":{"kernelspec":{"name":"ir","display_name":"R","language":"R"},"language_info":{"name":"R","codemirror_mode":"r","pygments_lexer":"r","mimetype":"text/x-r-source","file_extension":".r","version":"4.0.5"}},"nbformat_minor":4,"nbformat":4,"cells":[{"source":"<a href=\"https://www.kaggle.com/micmak/google-data-analytics-capstone?scriptVersionId=85940132\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"code","source":"# This R environment comes with many helpful analytics packages installed\n# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n# For example, here's a helpful package to load\n\nlibrary(tidyverse) # metapackage of all tidyverse packages\n\n# Input data files are available in the read-only \"../input/\" directory\n# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n\nlist.files(path = \"../input\")\n\n# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session","metadata":{"_uuid":"051d70d956493feee0c6d64651c6a088724dca2a","_execution_state":"idle","execution":{"iopub.status.busy":"2022-01-23T10:42:06.480161Z","iopub.execute_input":"2022-01-23T10:42:06.512739Z","iopub.status.idle":"2022-01-23T10:42:06.535716Z"},"trusted":true},"execution_count":2,"outputs":[{"output_type":"display_data","data":{"text/html":"'fitbit'","text/markdown":"'fitbit'","text/latex":"'fitbit'","text/plain":"[1] \"fitbit\""},"metadata":{}}]},{"cell_type":"markdown","source":"## 1. Introduction and scenario\nI am a junior data analyst working on the marketing analyst team at Bellabeat, a high-tech manufacturer of health-focused products for women. Bellabeat is a successful small company, but they have the potential to become a larger player in the global smart device market. Urška Sršen, cofounder and Chief Creative Officer of Bellabeat, believes that analyzing smart device fitness data could help unlock new growth opportunities for the company. I have been asked to focus on one of Bellabeat’s products and analyze smart device data to gain insight into how consumers are using their smart devices. The insights I discover will then help guide marketing strategy for the company. I will present my analysis to the Bellabeat executive team along with my high-level recommendations for Bellabeat’s marketing strategy.\n\nIn order to answer the key business questions, I will follow the steps of the data analysis process: **ask, prepare, process, analyze, share,** and **act**.","metadata":{}},{"cell_type":"markdown","source":"## 2. Data source\nSršen encourages me to use [FitBit Fitness Tracker Data](https://www.kaggle.com/arashnic/fitbit) that explores smart device users’ daily habits.\n\nThis Kaggle data set contains personal fitness tracker from thirty FitBit users. Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring. It includes information about daily activity, steps, and heart rate that can be used to explore users’ habits.","metadata":{}},{"cell_type":"markdown","source":"## 3. Data analysis and visualization\nFirst, I need to install and load the necessary packages for this analysis.","metadata":{}},{"cell_type":"code","source":"library(tidyverse)\ninstall.packages(\"skimr\")\nlibrary(skimr)","metadata":{"execution":{"iopub.status.busy":"2022-01-23T10:42:06.538286Z","iopub.execute_input":"2022-01-23T10:42:06.539877Z","iopub.status.idle":"2022-01-23T10:43:06.702923Z"},"trusted":true},"execution_count":3,"outputs":[{"name":"stderr","text":"Installing package into ‘/usr/local/lib/R/site-library’\n(as ‘lib’ is unspecified)\n\n","output_type":"stream"}]},{"cell_type":"markdown","source":"### A. Cleaning of data\nWe have a quick look on the csv file of daily activity.","metadata":{}},{"cell_type":"code","source":"daily_activity <- read.csv(\"../input/fitbit/Fitabase Data 4.12.16-5.12.16/dailyActivity_merged.csv\")","metadata":{"execution":{"iopub.status.busy":"2022-01-23T10:43:06.705351Z","iopub.execute_input":"2022-01-23T10:43:06.706811Z","iopub.status.idle":"2022-01-23T10:43:06.742826Z"},"trusted":true},"execution_count":4,"outputs":[]},{"cell_type":"code","source":"head(daily_activity)\nn_distinct(daily_activity$Id)","metadata":{"execution":{"iopub.status.busy":"2022-01-23T10:43:06.745338Z","iopub.execute_input":"2022-01-23T10:43:06.746738Z","iopub.status.idle":"2022-01-23T10:43:06.793617Z"},"trusted":true},"execution_count":5,"outputs":[{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 6 × 15</caption>\n<thead>\n\t<tr><th></th><th scope=col>Id</th><th scope=col>ActivityDate</th><th scope=col>TotalSteps</th><th scope=col>TotalDistance</th><th scope=col>TrackerDistance</th><th scope=col>LoggedActivitiesDistance</th><th scope=col>VeryActiveDistance</th><th scope=col>ModeratelyActiveDistance</th><th scope=col>LightActiveDistance</th><th scope=col>SedentaryActiveDistance</th><th scope=col>VeryActiveMinutes</th><th scope=col>FairlyActiveMinutes</th><th scope=col>LightlyActiveMinutes</th><th scope=col>SedentaryMinutes</th><th scope=col>Calories</th></tr>\n\t<tr><th></th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;chr&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;dbl&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th scope=col>&lt;int&gt;</th><th sco